import React from 'react'

export default function CityTime( { city } ) {

  

  const formattedTime = new Date().toLocaleString("en-US", { timeZone: city.timezone, hour: '2-digit', minute: '2-digit', second: '2-digit' });

  return (
    <div className='city-zone'>
      <h2 className='city-name'> { city.name } </h2>
      <div className='city-time'> Timezone: { city.timezone } </div>
    </div>
  )
}
